	string userName;
	string password;
	string msg = "";

	private async Task LoginAttempt()
	{
		var user = new Cyclist()
		{
			Username = userName,
			Password = password
		};

		user = await _userController.LoginAttempt(user);

		if (user != null)
		{

			_appState.SetUser(user);
			NavigationManager.NavigateTo("feed");
		}
		else
		{
			msg = "incorrect username or login";
			StateHasChanged();
		}
	}

